INSERT INTO `postovi` (`idpostovi`, `idkorisnik`, `sodrzina`, `data`, `pozitiveng`, `fax`) VALUES
(20, 'cobi123', 'Која е најдобрата агенција за да аплицирам за работа во текот на летото во Америка?', '10/02/2019 03:45:33 pm', 1, '0'),
(21, 'simon123', 'Јас сум веќе дипломиран студент на факултет за Информатика во Штип па доколку на некој му треба помош за некои од следниве предмети:Основи на програмирање,Објектно програмирање,Бази на податоци,Визуелно програмирање и по некои други,може слободно да ми пише и да дојде на часови,за цената ќе се договориме.', '10/02/2019 03:46:59 pm', 1, '1'),
(22, 'lili123', 'Дали некој знае друг начин за енкрипција на податоци освен md5?', '10/02/2019 04:00:00 pm', 1, '1'),
(23, 'maja123', 'Дипломирав на медицина пред некој месец и сега сакам да одам во странство да работам,дали некој има вакво искуство и кои документи треба да ги соберам и преведам?', '10/02/2019 04:01:57 pm', 1, '3'),
(24, 'toso123', 'Каде се прави најдобра забава за студенти во градов?', '10/02/2019 04:03:13 pm', 1, '0'),
(25, 'jana123', 'Знае ли некој приватна ординација во Радовиш која прима практиканти летово?', '10/02/2019 04:04:25 pm', 1, '3'),
(26, 'cacko123', 'Дали има некој овде на кој му е прифатен приговорт за стипендија,или ич да не се мачам со тоа?', '10/02/2019 04:05:33 pm', 1, '0'),
(27, 'anastasija123', 'Дали некој би сакал да ми направи семинарска по Е-бизнис.Треба да се направи шопинг страна со наши производи во Word Press.Јас не сум запознаена со тоа па сум спремна да си платам за семинарската.Заинтересираните нека ми пишат во порака.', '10/02/2019 04:07:44 pm', 1, '2'),
(28, 'jovana123', 'Доколку има некој што би сакал да ни објасни по предметот Основи на програмирање на мене и неколку колеги нека ми пише во порака.Се разбира дека ќе платиме.Ви благодарам однапред.', '10/02/2019 04:09:29 pm', 1, '1'),
(29, 'igor123', 'Дали некој можеби има да ми даде материјали по Анатомија?', '10/02/2019 04:10:53 pm', 1, '3'),
(30, 'angela123', 'Јас сум студент од трета година на Економски факултет во Штип и оваа лето би сакал да одам на пракса во Скопје,па дали би можеле да ми предложите фирми?', '10/02/2019 04:13:05 pm', 1, '2'),
(31, 'cacko123', 'Дали некој би сакал да ми прати материјали по предметот Бази на подтоци?', '10/02/2019 04:14:40 pm', 1, '1'),
(32, 'cobi123', 'Дали има некој на мрежава што работи во Мегантик-Струмица,ако може да ми пише би сакал да прашам нешто.', '10/02/2019 04:15:19 pm', 1, '1'),
(33, 'lili123', 'Јас и моите колеги би сакале да ги прашаме(доколку има) студентите кои беа на екскурзија мината година,како си поминаа,дали се задоволни од патувањето и агенцијата,би сакале неколку информации за и ние да одлучиме преку која агенција да одиме.', '10/02/2019 04:16:13 pm', 1, '0'),
(34, 'cobi123', 'Би сакал ли некој да ми даде број за резервација за студентска вечер во Клик?', '10/02/2019 04:16:47 pm', 1, '0');

